import React from 'react'

const Cart = ({ cartItems }) => {

    if (cartItems > 0) {
        return (
            <h1>pobre de mierda</h1>
        );
    }

    return (
        <section>
            <h1>holis</h1>
        </section>
    )
}

export default Cart
